export const getStudentList = async () =>{
    try {
        const response = await fetch('http://localhost:55217/api/folioclasses');
        const result = await response.json();  
        
        console.log(result);     
        
    } catch (error) {
        this.setState({ error: true })
        console.log(error);
    }
}
